define({"topics" : [{"title":"IVR","shortdesc":"\n               <p class=\"shortdesc\">Like most organisations, where possible, we would like to route incoming calls an         Auto Attendant. You can create one\n                  or more IVR (Auto Attendant) on the system to achieve it. \n               </p>\n            ","id":"concept_t4b_spw_rdb","href":"topic\/ivr.html","menu": {"hasChildren":false,},"tocID":"concept_t4b_spw_rdb-d46e10138","next":"concept_t4b_spw_rdb-d46e10138",},{"title":"Ring Group","shortdesc":"\n               <p class=\"shortdesc\">A ring group helps you to ring a group of extensions in a variety of ring strategies.         For example, you could define\n                  all the technical support guys&apos; extensions in a ring group and         ring the support guys one by one.\n               </p>\n            ","id":"concept_gmw_dvm_tdb","href":"topic\/ring_group.html","menu": {"hasChildren":false,},"tocID":"concept_gmw_dvm_tdb-d46e10483","next":"concept_gmw_dvm_tdb-d46e10483",},{"title":"Queue","shortdesc":"\n               <p class=\"shortdesc\">Queues are designed to receiving calls in a call center. </p>\n            ","id":"concept_yn1_gvm_tdb","href":"topic\/queue.html","menu": {"hasChildren":false,},"tocID":"concept_yn1_gvm_tdb-d46e10620","next":"concept_yn1_gvm_tdb-d46e10620",},{"title":"Conference","shortdesc":"\n               <p class=\"shortdesc\">Conference calls increase employee efficiency and productivity, and provide a more         cost-effective way to hold meetings.\n                  \n               </p>\n            ","id":"concept_x1v_hvm_tdb","href":"topic\/conference.html","menu": {"hasChildren":false,},"tocID":"concept_x1v_hvm_tdb-d46e10965","next":"concept_x1v_hvm_tdb-d46e10965",},{"title":"Call Pickup","shortdesc":"\n               <p class=\"shortdesc\">Call Pickup is a feature that allows a user to answer an incoming call that rings on a     telephone other than the userâ€™s\n                  own. \n               </p>\n            ","id":"topic_m3z_krq_bdb","href":"topic\/call_pickup.html","menu": {"hasChildren":false,},"tocID":"topic_m3z_krq_bdb-d46e11241","next":"topic_m3z_krq_bdb-d46e11241",},{"title":"Call Transfer","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">Yeastar Cloud PBX</span> supports Attended Transfer and Blind Transfer, users can     dial the feature code to transfer a call on their phones.\n               </p>\n            ","id":"topic_kgg_bhp_bdb","href":"topic\/call_transfer.html","menu": {"hasChildren":false,},"tocID":"topic_kgg_bhp_bdb-d46e11655","next":"topic_kgg_bhp_bdb-d46e11655",},{"title":"Callback","shortdesc":"\n               <p class=\"shortdesc\">Callback feature allows callers to hang up and get called back to the PBX. Callback         feature could reduce the cost\n                  for the users who work out of the office using their own         mobile phones.\n               </p>\n            ","id":"concept_pz5_qvm_tdb","href":"topic\/callback.html","menu": {"hasChildren":false,},"tocID":"concept_pz5_qvm_tdb-d46e11858","next":"concept_pz5_qvm_tdb-d46e11858",},{"title":"Speed Dial","shortdesc":"\n               <p class=\"shortdesc\">Sometimes you may just need to call someone quickly without having to look up his\/her         phone number. You can by simply\n                  define a shortcut number. You can use Speed Dial  feature to         place a call by pressing a reduced number of keys.\n               </p>\n            ","id":"concept_wf3_tvm_tdb","href":"topic\/speed_dial.html","menu": {"hasChildren":false,},"tocID":"concept_wf3_tvm_tdb-d46e11996","topics":[]},{"title":"DISA","shortdesc":"\n               <p class=\"shortdesc\">DISA (Direct Inward System Access) allows users outside the office to make calls         through the PBX&apos;s trunks. For the\n                  staffs who are outside the office, they can use DISA         feature to take advantage of lower long-distance rates that are\n                  provided by the PBX         trunks.\n               </p>\n            ","id":"concept_qvh_vvm_tdb","href":"topic\/disa.html","menu": {"hasChildren":false,},"tocID":"concept_qvh_vvm_tdb-d46e12065","next":"concept_qvh_vvm_tdb-d46e12065",},{"title":"One Touch Record","shortdesc":"\n               <p class=\"shortdesc\">During a call, you can dial the One Touch Record feature code to start recording the     call; dial the feature code again\n                  to stop the recording.\n               </p>\n            ","id":"topic_d1p_mbr_bdb","href":"topic\/one_touch_record.html","menu": {"hasChildren":false,},"tocID":"topic_d1p_mbr_bdb-d46e12203","topics":[]},{"title":"Call Recording","shortdesc":"\n               <p class=\"shortdesc\">Call Recording is a feature that enables the PBX to automatically record internal         calls, external calls, and conference\n                  calls. \n               </p>\n            ","id":"concept_tsn_tbb_ydb","href":"topic\/call_recording.html","menu": {"hasChildren":false,},"tocID":"concept_tsn_tbb_ydb-d46e12273","next":"concept_tsn_tbb_ydb-d46e12273",},{"title":"Intercom\/Paging","shortdesc":"\n               <p class=\"shortdesc\">The Paging and Intercom features allow you to make an announcement to a group of     extensions. The called parties do not\n                  need to pick up the handset as the audio will be played     via the phone speakers. \n               </p>\n            ","id":"topic_fh3_nbw_bdb","href":"topic\/intercom_and_paging.html","menu": {"hasChildren":false,},"tocID":"topic_fh3_nbw_bdb-d46e12765","next":"topic_fh3_nbw_bdb-d46e12765",},{"title":"Call Parking","shortdesc":"\n               <p class=\"shortdesc\">Call Parking is a feature that allows you to suspend a call for an extended period of     time and then retrieve that call\n                  from any extension.\n               </p>\n            ","id":"topic_bc2_vfr_bdb","href":"topic\/call_parking.html","menu": {"hasChildren":false,},"tocID":"topic_bc2_vfr_bdb-d46e13110","next":"topic_bc2_vfr_bdb-d46e13110",},{"title":"Fax","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">Yeastar Cloud PBX</span> supports Fax over IP. You can send or receive a fax via a         physical fax machine or receive a fax over the network.\n               </p>\n            ","id":"concept_mqd_ccc_wdb","href":"topic\/fax.html","menu": {"hasChildren":false,},"tocID":"concept_mqd_ccc_wdb-d46e13317","next":"concept_mqd_ccc_wdb-d46e13317",}]});